import { createStore } from 'vuex';
const store = new createStore({
    state() {
        return {
            menu: null
        };
    },
    mutations: {
        setMenu(state, menu) {
            state.menu = menu;
        }
    },
    actions: {
        updateMenu({ commit }, menu) {
            commit('setMenu', menu);
        }
    }
});

export default store;
